    function initialize(
        DataTypes.ProjectMetaData memory _metaData,
        DataTypes.ProjectData memory _projectData,
        DataTypes.ProtocolData memory _protocolData,
        uint256 _curatorFee,
        address _bToken,
        address _cToken
